INSERT INTO `mail_template_translation` VALUES (_binary 'ò\Â_IsPÖz\'\’<Ç)',_binary 'ò\Â_Kr§ÜHa∫Bµæ','{{ salesChannel.translated.name }}','Newsletter','','<h3>Hallo {{ newsletterRecipient.firstName }} {{ newsletterRecipient.lastName }}</h3>\n                <p>Sch√∂n, dass Sie sich f√ºr unseren Newsletter interessieren!</p>\n                <p>Um einem Missbrauch Ihrer E-Mail-Adresse vorzubeugen, haben wir Ihnen diese Best√§tigungsmail gesendet. Best√§tigen Sie, dass Sie den Newsletter regelm√§√üig erhalten wollen, indem Sie <a href=\"{{ url }}\">hier</a> klicken.</p>\n                <p>Sollten Sie den Newsletter nicht angefordert haben, ignorieren Sie diese E-Mail.</p>\n        ','Hallo {{ newsletterRecipient.firstName }} {{ newsletterRecipient.lastName }}\n\n                Sch√∂n, dass Sie sich f√ºr unseren Newsletter interessieren!\n\n                Um einem Missbrauch Ihrer E-Mail-Adresse vorzubeugen, haben wir Ihnen diese Best√§tigungsmail gesendet. Best√§tigen Sie, dass Sie den Newsletter regelm√§√üig erhalten wollen, indem Sie auf den folgenden Link klicken: {{ url }}\n\n                Sollten Sie den Newsletter nicht angefordert haben, ignorieren Sie diese E-Mail.\n        ',NULL,'2025-08-26 07:54:43.870',NULL),(_binary 'ò\Â_IsPÖz\'\’<Ç)',_binary '/ª_\‚\‚öMp™XT\Œ|\„\‚','{{ salesChannel.translated.name }}','Newsletter','','<h3>Hello {{ newsletterRecipient.firstName }} {{ newsletterRecipient.lastName }}</h3>\n                <p>Thank you for your interest in our newsletter!</p>\n                <p>In order to prevent misuse of your email address, we have sent you this confirmation email. Confirm that you wish to receive the newsletter regularly by clicking <a href=\"{{ url }}\">here</a>.</p>\n                <p>If you have not subscribed to the newsletter, please ignore this email.</p>\n        ','Hello {{ newsletterRecipient.firstName }} {{ newsletterRecipient.lastName }}\n\n                Thank you for your interest in our newsletter!\n\n                In order to prevent misuse of your email address, we have sent you this confirmation email. Confirm that you wish to receive the newsletter regularly by clicking on the link: {{ url }}\n\n                If you have not subscribed to the newsletter, please ignore this email.\n        ',NULL,'2025-08-26 07:54:43.857',NULL),(_binary 'ò\Â_IsPÖz\'\’0s',_binary 'ò\Â_Kr§ÜHa∫Bµæ','{{ salesChannel.translated.name }}','Register','','<h3>Hallo {{ newsletterRecipient.firstName }} {{ newsletterRecipient.lastName }}</h3>\n                <p>vielen Dank f√ºr Ihre Anmeldung.</p>\n                <p>Sie haben sich erfolgreich zu unserem Newsletter angemeldet.</p>\n        ','Hallo {{ newsletterRecipient.firstName }} {{ newsletterRecipient.lastName }}\n\n                vielen Dank f√ºr Ihre Anmeldung.\n\n                Sie haben sich erfolgreich zu unserem Newsletter angemeldet.\n        ',NULL,'2025-08-26 07:54:43.913',NULL),(_binary 'ò\Â_IsPÖz\'\’0s',_binary '/ª_\‚\‚öMp™XT\Œ|\„\‚','{{ salesChannel.translated.name }}','Register','','<h3>Hello {{ newsletterRecipient.firstName }} {{ newsletterRecipient.lastName }}</h3>\n                <p>thank you very much for your registration.</p>\n                <p>You have successfully subscribed to our newsletter.</p>\n        ','Hello {{ newsletterRecipient.firstName }} {{ newsletterRecipient.lastName }}\n\n                thank you very much for your registration.\n\n                You have successfully subscribed to our newsletter.\n        ',NULL,'2025-08-26 07:54:43.902',NULL),(_binary 'ò\Â_K[pƒäówN',_binary 'ò\Â_Kr§ÜHa∫Bµæ','{{ salesChannel.name }}','Bestellbest√§tigung','','<div style=\"font-family:arial; font-size:12px;\">\n\n    {% set currencyIsoCode = order.currency.isoCode %}\n\n    Hallo {% if order.orderCustomer.salutation %}{{ order.orderCustomer.salutation.translated.letterName ~ \' \' }}{% endif %}{{ order.orderCustomer.firstName }} {{ order.orderCustomer.lastName }},<br>\n    <br>\n    Ihre Bestellung ist am {{ order.orderDateTime|format_datetime(\'medium\', \'short\', locale=\'de-DE\') }} bei uns eingegangen.<br>\n    <br>\n    Bestellnummer: {{ order.orderNumber }}<br>\n    <br>\n    Sobald ein Zahlungseingang erfolgt ist, erhalten Sie eine separate Benachrichtigung und Ihre Bestellung wird verarbeitet.<br>\n    <br>\n    Den aktuellen Status Ihrer Bestellung k√∂nnen Sie jederzeit √ºber diesen Link abrufen: {{ rawUrl(\'frontend.account.order.single.page\', { \'deepLinkCode\': order.deepLinkCode }, salesChannel.domains|first.url) }}<br>\n    √úber diesen Link k√∂nnen Sie auch die Bestellung bearbeiten, die Zahlungsart wechseln oder nachtr√§glich eine Zahlung durchf√ºhren.<br>\n    <br>\n    <strong>Informationen zu Ihrer Bestellung:</strong><br>\n    <br>\n\n    <table border=\"0\" style=\"font-family:Arial, Helvetica, sans-serif; font-size:12px;\">\n        <tr>\n            <td bgcolor=\"#F7F7F2\" style=\"border-bottom:1px solid #cccccc;\"><strong>Produkt-Nr.</strong></td>\n            <td bgcolor=\"#F7F7F2\" style=\"border-bottom:1px solid #cccccc;\"><strong>Produktbild</strong></td>\n            <td bgcolor=\"#F7F7F2\" style=\"border-bottom:1px solid #cccccc;\"><strong>Bezeichnung</strong></td>\n            <td bgcolor=\"#F7F7F2\" style=\"border-bottom:1px solid #cccccc;\"><strong>Menge</strong></td>\n            <td bgcolor=\"#F7F7F2\" style=\"border-bottom:1px solid #cccccc;\"><strong>Preis</strong></td>\n            <td bgcolor=\"#F7F7F2\" style=\"border-bottom:1px solid #cccccc;\"><strong>Summe</strong></td>\n        </tr>\n\n        {% for lineItem in order.nestedLineItems %}\n            {% set nestingLevel = 0 %}\n            {% set nestedItem = lineItem %}\n            {% block lineItem %}\n                <tr>\n                    <td>{% if nestedItem.payload.productNumber is defined %}{{ nestedItem.payload.productNumber|u.wordwrap(80) }}{% endif %}</td>\n                    <td>{% if nestedItem.cover is defined and nestedItem.cover is not